.contain{
  display: flex;
  flex-direction: column;
  position: absolute;
  width: 100%;
  height: 100%;
  background-size:750rpx 100%;
  background-image: url(data:image/jpeg;base64,);
  background-repeat:no-repeat;
  transition: all 5s;

  .middle-contain{
    position: relative;
    width: auto;
    height: auto;
    transition: all 5s;
    ul{
      position: absolute;
      width: 100%;
      height: 100%;
      li{
        width:250rpx;
        height: 250rpx;
        box-shadow: 0 0 10px #000;
        position: absolute;
        transition: all 5s;
        left: 0rpx;
        top: 0rpx;
        transform: rotate(0);
        img{
          position: relative;
          width: 250rpx;
          height: 250rpx;
        }
      }
    }
  }
}
